 no to others. There's a fear that if they say no they'll lose that person and to avoid the potential abandonment many will never learn to say no. Please understand that saying no, having boundaries and standards for how you'll be treated is your right and always has been. Establishing them sends the message that you have self-respect. If you define a standard or boundary and it is met by others with anything other than respect then that person was not for you to begin with. Standards are sexy and self-worth is hot, build it. If you are struggling to speak your needs invest in your emotional development. Growing older is out of control but growing up is 100% on us. Twitter Creds: @survivingpills
